import React from "react";

const Footer = () => {
  const footerStyle = {
    backgroundColor: "#f1f1f1",
    textAlign: "center",
    padding: "1rem 0",
    marginTop: "auto",
  };

  return (
    <footer style={footerStyle}>
      <p style={{ margin: 0 }}>
        &copy; {new Date().getFullYear()} AI Voice Chat. All rights reserved.
      </p>
    </footer>
  );
};

export default Footer;
